Stiri din - Afaceri & Economie   11:12 Arvato Services îşi extinde prezenţa în România cu un centru dedicat pentru Opel la Bucureşti şi un departament de dezvoltare IT la Braşov 
Arvato Services, firmă deţinută de grupul media german Bertelsmann, cu peste 1.500 de angajaţi în Braşov, Sibiu şi Cluj-Napoca, a intrat şi pe piaţa din Bucureşti, cu un centru dedicat pentru Opel, care va ajunge la 80 de angajaţi până la finele anului, de la 30 în prezent. 
